import React from 'react'

import Sectors from 'C:/MY_PROJECT/final/src/rawData/sectorNames.json'
import { Link } from 'react-router-dom'

const UserPage = () => {

  var sectorName =Sectors

  function selectNgo(e){
    // e.preventDefault()
    alert("hello")
    
  }



  return (
    <div className="userPage">
        <div style={{border:"1px solid red", textAlign:"center"}} className="stickyCheck m-5"><h3>Select sector you want to donate</h3></div>
        <div className='userPageCards m-3'>
            {sectorName.map(item => 

                <button onClick={selectNgo}>
                <div className='d-flex flex-column flex-wrap w-25 border border-warning p-2 m-1 card'  >
                    <img className="sector" id="sector" src={item.back_image} ></img>
                    <button onClick={selectNgo}><span className='w-100 text-align-center downName mt-1'>{item.sector_name}</span></button>
                </div>    
                </button>     
            )}
        
        </div>
    </div>
  )
}

export default UserPage
